import React, {useEffect, Component} from 'react';
import Todo from './Todo';
import './css/AppCss.css';

class App extends Component {
  constructor(props: any){
    super(props);

  }
  year: string = this.class_date().getFullYear().toString();
  month: string = this.class_date().getMonth().toString();
  day: string = this.class_date().getDay().toString();

  class_date() : Date{
    return new Date();
  }

  text_date() : string{
    return this.year+' '+this.month+'/'+this.day;
  }

  render() {
    return(
      <div className="App">
      <div className="App-Sub">
      <ul>
      <li><Todo form={this.text_date()} todo = "하이2dasddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddd"/> </li>
      <li><Todo form="하이" todo = "하이2"/> </li>
      </ul>
      </div>
      <div className = "App-Sub">
      <div className="App-Img">
      <img className = "App-Add-Img" src="AddImg.png"/>
      </div>
      <div className="App-Img">
      <img className = "App-Exit-Img" src="ExitImg.png"/>
      </div>
      </div>
      </div>
    );
  }

}

export default App;
